import React from 'react';
import './log.css';

const Login = () => {
    return (
        
        <form>
        <div class="row row-cols-1 row-cols-md-2 g-4">
        <div className='from' class="col shadow p-3 mb-5 bg-body-tertiary rounded" >
        <div class="mb-3" className='login'>
          <h4 style={{padding: "10px"}}>Wellcome</h4>
          <label for="usernam" class="form-label" style={{padding: "10px"}} >User Name</label>
          <input type="username" class="form-control" id="exampleInputusername" aria-describedby="username" style={{padding: "10px"}} />
          <label for="password" class="form-label" style={{padding: "10px"}} >Password</label>
          <input type="password" class="form-control" id="exampleInputPassword1" style={{padding: "10px"}} />
        <button type="submit" class="btn btn-secondary" style={{padding: "10px"}}>Login</button>
        </div>
        </div>
        </div>
      </form>
    );
};

export default Login;
